struct PairHash {
	size_t operator()(const pair<int, int> p) const { // передавать pair<int, int> по ссылке или нет?

		return (size_t)(h_i_1(p.first) * 37 * 37 + h_i_1(p.second) * 37 + 117);
	}
	hash<int> h_i_1;
	hash<int> h_i_2;
};


// тип cnt <-- "-108 <= points[i][j] <= 10^8"
 // "const" будет ошибкой, так как можем обратится к несущест-у элементу в "PointToExist[{cnt - point[0], point[1]}]"
bool CheckCoordinate(const vector<vector<int>>& points, /*const*/ unordered_map<pair<int, int>, bool, PairHash>& PointToExist, const int cnt/* = x_min + x_max*/) {
	for (/*const*/ auto point : points) { // "const" будет ошибкой, так как можем обратится к несущест-у элементу в "PointToExist[{cnt - point[0], point[1]}]"

		if (!PointToExist[{cnt - point[0], point[1]}]) { return false; }
	}
	return true;
}

/*
Если расположить PairHash ниже CheckCoordinate, то в MSVS будет ошибка: Error (active)	E0308	more than one instance of overloaded function "CheckCoordinate" matches the argument list:	
*/

bool isReflected(const vector<vector<int>>& points) {

	if (points.empty()) { return true; } // проверка пустого points -- такой тест есть в тестирующей системе
	int x_min = points.front().front();
	int x_max = points.back().front();
	unordered_map<pair<int, int>, bool, PairHash> PointToExist; // необходимо для реализации CheckCoordinate

	for (const auto& point : points) {

		const int x = point[0];
		const int y = point[1];
		x_min = min(x_min, x);
		x_max = max(x_max, x); 
		if (!PointToExist[{x, y}]) { PointToExist[{x, y}] = true; }

	} // отрезок, проходящий через (x_min, y*) и (x_max, y*) будет иметь максимальную длину. Примечательно, что не получатся рассуждения через поиск концов отрезка минимальной длины!

	// if(PointToExist.size() % 2 == 1){return false;} // check it!
	return CheckCoordinate(points, PointToExist, x_min + x_max);
}

#include <iostream>
#include<cassert>
#include <array>
#include <string_view>

using namespace std; 

constexpr int SIZE_ALPHABET = 128;

class Solution {

private:

    // https://github.com/SkosMartren/leetcode_com/blob/main/README.md#setting-the-size-of-an-array-in-a-private-section
    //constexpr int SIZE_ALPHABET = 128; // 'Solution::SIZE_ALPHABET' cannot be declared with 'constexpr' specifier // почему так?
    int LengthSubstr = 0;
public:

    int lengthOfLongestSubstringTwoDistinct(string_view s, int k = 2) { // "0 <= k <= 50"

        if (k <= 0) { return LengthSubstr; }

        array<int, SIZE_ALPHABET> CharToCount; CharToCount.fill(0);

        for (int RightBorderWindow = 0, LeftBorderWindow = 0; RightBorderWindow <= s.size() - 1; ++RightBorderWindow) { // move Right ptr

            if (++CharToCount[s[RightBorderWindow]] == 1) { // новая буква (CharToCount[RightBorderWindow]) в sliding window
                --k;
            } // RightBorderWindow указывет на последний символ sliding window 

            while (LeftBorderWindow < RightBorderWindow && k < 0) { // move Left ptr

                if (--CharToCount[s[LeftBorderWindow]] == 0) {
                    ++k;
                }
                ++LeftBorderWindow;
            } // LeftBorderWindow указывет на первый символ sliding window

            LengthSubstr = max(LengthSubstr, RightBorderWindow - LeftBorderWindow + 1);
            assert(LeftBorderWindow <= RightBorderWindow);
        }

        return LengthSubstr;
    }

};

int main() {
    cout << Solution().lengthOfLongestSubstringTwoDistinct("abc") << '\n';
    cout << Solution().lengthOfLongestSubstringTwoDistinct("aaa") << '\n';
    cout << Solution().lengthOfLongestSubstringTwoDistinct("aAaA") << '\n';
    cout << Solution().lengthOfLongestSubstringTwoDistinct("aA~aA") << '\n';
    cout << Solution().lengthOfLongestSubstringTwoDistinct("aAaA") << '\n';
    cout << Solution().lengthOfLongestSubstringTwoDistinct("ccaabbb") << '\n';
    cout << Solution().lengthOfLongestSubstringTwoDistinct("eceba") << '\n';    
}
